INSERT INTO `nameDef` VALUES (1, 'Trouble Melts', 'Melt your troubles away with these small creamy truffles made from shea, kokum and cocoa butters designed to melt in the bath water to soften your skin and calm your troubled head. Tangerine is a sweet, peace inducing citrus great for lifting your spirits and soothing your nerves. Pink Grapefruit can help treat mood swings, anger and depression. Just the right Treat after a stressful day. (Our apologies but our truffles are only available for overnight or 2nd day shipping during the hot summer months.)');
INSERT INTO `nameDef` VALUES (2, 'Cocoa Truffle', 'How about some hot cocoa? Cocoa butter that is, made from the roasted seeds of the cocoa bean, combined with soothing shea butter and vitamin E to condition and soften the skin. As the truffle melts in the warm bath, your skin is scented with yummy chocolate. Your body will be so moisturized after this little dream there will be no need for lotion. (Our apologies but just like real chocolates during hot summer months these little yummies must be shipped to you overnight!) ');
INSERT INTO `nameDef` VALUES (3, 'Lavender LemonAid', 'A Treat for sore achy muscles, we combined dead sea salts for detoxifying with jojoba and evening primrose to moisturize. Green tea adds antioxidants while healthy doses of lavender and lemongrass relax and sooth aching muscles. ');
INSERT INTO `nameDef` VALUES (4, 'Brown Sugar Bath Crumbs', 'Feeling crumby? Treat yourself and soak in a warm sugar bath that will fizz your blues away while cocoa butter sprinkles sooth dry skin. Brown sugar helps treat and heal wounds when applied externally, combined with delicious flavors, soothing honey and vitamin E. Finally a sugary treat that\'s good for you, but you have to do your part as well so remember to walk your two miles a day, eat more fruits and veggies and cut out the sugar and cigs (you\'re sweet and smokin already). Pour in warm bath for a moisturizing treat. ');
INSERT INTO `nameDef` VALUES (5, 'Brown Sugar Smoothie', 'You\'ll be smooth and sweet after this moisturizing Treat. Pure brown sugar is blended with therapeutic oils, shea butter and vitamin E creating an entirely natural and moisturizing exfoliant, and its delicious smell lingers long after your shower. Use before self-tanner or shaving. Do not use on scraped or broken skin.');
INSERT INTO `nameDef` VALUES (6, 'Chronic Tonic', 'This Treat contains vitamin rich grape seed oil, combined with highly therapeutic avocado and hemp seed oils for their healing and regenerating properties. Jojoba and vitamin E provide antioxidants to protect the skin. Helps to soften and heal chronic dry skin. We added pink grapefruit because we love the yummy smell and lavender to sooth and heal. Use before, during or after bath.');
INSERT INTO `nameDef` VALUES (7, 'Fizzy Milk Treatment', 'Anti-stress treatment. Soak your cares away while softening your skin. This Treat contains minerals from the earth to relax you and milk and honey to tone an soften your skin. Use 3-5 tablespoons per bath. ');
INSERT INTO `nameDef` VALUES (18, 'Creamy Bubble Gum Bath', 'Dunk yourself in this creamy candy bath with soothing shea butter, cocoa butter and vitamin E. Bathe in this milky bubble gum flavored Treat and someone may try to take a bite out of you, delicious!');
INSERT INTO `nameDef` VALUES (8, 'Sweet Treat', 'White bakery box filled with yummy treats and wrapped with a red ribbon. Treat yourself or someone sweet to a Box O\'Treats.\r\n\r\nSweet Treat contains Brown Sugar Smoothie, Trouble Melts and .5oz Sweet Blend ');
INSERT INTO `nameDef` VALUES (9, 'Salty Treat', 'White bakery box filled with yummy treats and wrapped with a red ribbon. Treat yourself or someone sweet to a Box O\'Treats.\r\n\r\nSalty Treat contains 8oz Lavender LemonAid, Trouble Melts, Cocoa Truffle and Relax Blend');
INSERT INTO `nameDef` VALUES (10, 'Soothing Treat', 'White bakery box filled with yummy treats and wrapped with a red ribbon. Treat yourself or someone sweet to a Box O\'Treats.<br />\r\n<br />\r\nSoothing Treat contains 4oz Chronic Tonic, Trouble Melts, Cocoa Truffle and .5 Balance Blend');
INSERT INTO `nameDef` VALUES (11, 'Milky Treat', 'White bakery box filled with yummy treats and wrapped with a red ribbon. Treat yourself or someone sweet to a Box O\'Treats.\r\n\r\nMilky Treat contains 8oz Fizzy Milk Treatment, Trouble Melts, Cocoa Truffle and Balance Blend');
INSERT INTO `nameDef` VALUES (12, 'Balance Blend', 'With our pure essential oil blends you can Treat yourself to the healthful benefits of aromatherapy in a relaxing bath or massage.\r\n\r\n');
INSERT INTO `nameDef` VALUES (13, 'Relax Blend', 'With our pure essential oil blends you can Treat yourself to the healthful benefits of aromatherapy in a relaxing bath or massage.\r\n\r\n');
INSERT INTO `nameDef` VALUES (14, 'Sweet Blend', 'With our pure essential oil blends you can Treat yourself to the healthful benefits of aromatherapy in a relaxing bath or massage.\r\n\r\n');
INSERT INTO `nameDef` VALUES (15, 'Treat Trouble Melts', 'Melt your troubles away with these small creamy truffles made from shea, kokum and cocoa butters designed to melt in the bath water to soften your skin and calm your troubled head. Just the right Treat after a stressful day. Each Trouble Melt box contains 2 truffles. ');
INSERT INTO `nameDef` VALUES (17, 'Beauteaful Face Scrub', 'Treat\'s antioxidant rich Beauteaful Face Scrub contains organic polyphenols of Green Tea and White Tea to protect while it removes dead skin cells. Known to be nature\'s most powerful antioxidant, green tea extract provides  protection against free radicals and DNA damage. Aloe vera, olive butter, avocado butter and vitamin E soothe the newly revealed glowing skin. ');
INSERT INTO `nameDef` VALUES (16, 'Sugar & Spice Smoothie', 'You\'ll be smooth and sweet after this moisturizing Treat. Pure sugars blended with therapeutic oils, soothing shea butter, vitamin E and delicious cinnamon. Smooth on from head, to tush to toes. ');
INSERT INTO `nameDef` VALUES (19, 'Handy Candy Cream', 'Nourish and soothe dry overworked hands with this dreamy whipped cream. We blended decadent shea butter and milk to soften with white tea to protect and a dash of sweet vanilla to make a yummy Treat. ');
INSERT INTO `nameDef` VALUES (20, 'Lemon Drop Creamy Cleanser', 'Sweetie Pie we all have to be up earlier than we\'d like most mornings. Suds yourself with this refreshing shower cream with soothing cocoa butter, vitamin E and milk that brings back memories of cheeks filled with lemon drops. So rub this everywhere including your cheeks and start your day with a Treat. ');
INSERT INTO `nameDef` VALUES (21, 'Luscious Honey Lotion', 'Honey you\'ve never felt so sweet! Smother yourself from cheeks to toes with this luscious body lotion blended with soothing shea butter, honey and white tea to protect and heal damaged skin. Flavored with  vanilla and lemon to sweeten things up, this creamy dream will leave you soft and delicious. Your skin will love this milky Treat.');
INSERT INTO `nameDef` VALUES (22, 'Peppermint Patty', 'Your hands and feet will be soft and sweet after this nourishing Treat. Exfoliates and smoothes  with hemp and molasses as it moisturizes. Contains decadent shea butter, soothing aloe vera and vitamins. And best of all it smells like a candy cane, so delicious! ');
INSERT INTO `nameDef` VALUES (23, 'Saving Face', 'A moisturizing Treat to protect, smooth and heal. Contains soothing shea butter, sweet almond and camellia oil. Alpha lipoic acid helps to smooth fine lines, diminish discoloration of the skin and encourage cell renewal. Protects and prevents with vitamins A, C and E as well as antioxidant rich green tea and white tea. ');
INSERT INTO `nameDef` VALUES (24, 'Sweet Face Cleansing Milk', 'Gentle cleansing for sensitive or mature skin. This soothing Treat gently cleans and protects with orange peel tincture, shea butter and lavender. Removes makeup without stripping the skin and leaves skin smooth and moist.');
INSERT INTO `nameDef` VALUES (25, 'Clearly Sweet Blemish Gel', 'Heal and prevent blemishes with Treat\'s antiseptic and antioxidant treatment serum containing cucumber extract and calendula. Rich in antioxidants green tea, white tea and vitamins A, C and E to prevent scarring. Can be used as a spot treatment or lightly layered on the face. ');
INSERT INTO `nameDef` VALUES (26, 'Pretty Sweet', 'Treat yourself or someone sweet to a Box O\'Treats! Pretty Sweet contains Creamy Bubble Gum Bath, Handy Candy Cream and Peppermint Patty.');
INSERT INTO `nameDef` VALUES (27, 'Truffle Trio', 'Treat yourself or someone sweet to a Box O\'Treats! Truffle Trio contains 2 boxes of Trouble Melts and 1 Cocoa Truffle.');
INSERT INTO `nameDef` VALUES (28, 'Cheeky Treat', 'Treat yourself or someone sweet to a Box O\'Treats. Cheeky Treat contains Saving Face, Beauteaful Face Scrub, Sweet Face Cleansing Milk and Clearly Sweet Blemish Gel.');
